import * as React from "react";
import { EducationCard } from "./components/EducationCard";
import { FeatureItem } from "./components/FeatureItem";
import { AboutSection } from "./components/AboutSection";
import { ContactForm } from "./components/ContactForm";
import { FormData } from "./types";

const cardData = [
  { title: "ENGLISH", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" },
  { title: "SPANISH", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" },
  { title: "GERMAN", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" },
  { title: "ELEPHANT", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" },
  { title: "ENGLISH", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" },
  { title: "ENGLISH", imageSrc: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/9a4ad4eb7a90abfd1f810f89699fad8b43391efb3acb3ca23bd3c5592fe1dc17?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&" }
];

const features = [
  { icon: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/423f71942caef1d0ccc6ce5030499ffecff163b767d87627a125edea5e65528d?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&", text: "Fast Student assistant" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/6da1d80f5aebff320430600a60b260577d918cf997a2ac5ca7c3890bb7f50f78?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&", text: "High quality online classes" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/be7f30f32c9eecdb0b195c142c8e4b43b946026504023503f90b0bb0f20a8a1b?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&", text: "One click help" },
  { icon: "https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/d4d989f9e2cddaab75419bcb55fed8b5bb1aa0d3c6f2f9e766a030a171be2406?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&", text: "Customer satisfaction" }
];

const aboutSections = [
  {
    title: "Our History",
    description: "Since our establishment in 2024, we have been dedicated to providing quality education to students from all over the world. We started as a small language school, and have since expanded to offer a wide range of programs in various fields."
  },
  {
    title: "Our Faculty",
    description: "Our faculty consists of experienced educators and professionals who are passionate about their fields and committed to providing the best possible education to our students."
  },
  {
    title: "Our Partnerships",
    description: "We have established partnerships with leading educational institutions and organizations around the world. These partnerships allow us to offer our students unique opportunities."
  }
];

const App: React.FC = () => {
  const handleSubmit = (data: FormData) => {
    console.log('Form submitted:', data);
  };

  return (
    <div className="flex overflow-hidden flex-col pb-11 bg-black">
      {/* Hero Section */}
      <div className="flex overflow-hidden flex-col w-full bg-neutral-200 max-md:max-w-full">
        <div className="flex relative flex-col px-1.5 w-full min-h-[836px] pb-[736px] max-md:pb-24 max-md:max-w-full">
          <img
            loading="lazy"
            src="https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/bd8e855169c1d422f8621fddfa53cfab8178fc7c48d0d4c1482ad1aba4f7f999?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&"
            alt="Hero background"
            className="object-cover absolute inset-0 size-full"
          />
          <img
            loading="lazy"
            src="https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/8318fdc6eb4dc843d1df857a05a44c099d2f94a89b13189e370256c4334d53fe?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&"
            alt="Hero foreground"
            className="object-contain mb-0 w-full aspect-[14.29] rounded-[123px] max-md:mb-2.5 max-md:max-w-full"
          />
        </div>
      </div>

      {/* Features Section */}
      <div className="flex overflow-hidden flex-col pt-2.5 pb-12 w-full text-base text-black bg-cyan-400 max-md:max-w-full">
        <div className="flex flex-wrap gap-10 justify-center items-center p-8 w-full font-semibold max-md:px-5 max-md:max-w-full">
          {features.map((feature, index) => (
            <FeatureItem key={index} {...feature} />
          ))}
        </div>
      </div>

      {/* Cards Section */}
      <div className="flex flex-wrap gap-16 justify-center items-center px-2.5 py-16 w-full text-xl leading-none whitespace-nowrap max-md:max-w-full">
        {cardData.map((card, index) => (
          <EducationCard key={index} {...card} />
        ))}
      </div>

      {/* About Section */}
      <div className="self-center mt-8 w-full max-w-[1190px] max-md:max-w-full">
        <div className="flex gap-5 max-md:flex-col">
          {aboutSections.map((section, index) => (
            <AboutSection key={index} {...section} />
          ))}
        </div>
      </div>

      {/* Contact Section */}
      <div className="flex flex-col items-center px-20 pt-20 pb-52 mt-24 w-full bg-zinc-300 rounded-[30px] max-md:px-5 max-md:pb-24 max-md:mt-10 max-md:max-w-full">
        <div className="flex flex-col justify-center mb-0 w-full max-w-[1250px] max-md:mb-2.5 max-md:max-w-full">
          <h2 className="text-6xl font-bold leading-tight text-center text-indigo-950 max-md:max-w-full max-md:text-4xl">
            Contact Us
          </h2>
          <div className="flex flex-wrap gap-10 justify-center items-center mt-12 w-full max-md:mt-10 max-md:max-w-full">
            <ContactForm onSubmit={handleSubmit} />
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="flex gap-10 items-start self-center mt-10 max-w-full text-xl font-medium tracking-wider leading-none text-center text-white w-[412px]">
        <button className="hover:underline focus:outline-none focus:ring-2 focus:ring-white" tabIndex={0}>
          Terms & Conditions
        </button>
        <button className="hover:underline focus:outline-none focus:ring-2 focus:ring-white" tabIndex={0}>
          Privacy Policy
        </button>
      </footer>
    </div>
  );
};

export default App;
